import React from 'react'
import makeNavbar from '../../assets/navbarCreater'
import { TNavItem } from '../Navbar/NavbarContainer'

type TProps = {
    loginMenuItems: Array<TNavItem>
}

const LoginMenu: React.FC<TProps> = React.memo(({loginMenuItems}) => {



    return (
        <div className='capitalize list-none w-screen sm:w-72 bg-white text-black text-lg font-bold'>
            <ul>
                {makeNavbar(loginMenuItems)}
            </ul>
        </div>
    )
})

export default LoginMenu
